import React, {Component} from 'react';
import {Redirect, Route, Switch} from "react-router";
import View from "../../components/View";

class Admin extends Component {
    render() {
        return (
            <>
                <Switch>
                    <Route path='/admin/view' component={View}/>
                    <Redirect to={View}/>
                </Switch>
            </>
        );
    }
}

export default Admin;
